package colle;

public class LogicalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println((10>7)&&(56>45)); 
		System.out.println((76>34)&&(23<34));  
		System.out.println((34>45)&&(34>23));
		System.out.println((10>7)||(56>45)); 
		System.out.println((76>34)||(23<34));  
		System.out.println((34>45)||(34>23));
		System.out.println((23<11)||(9>56));
	}

}
